testTable.css:
/* Style for the table */
table {
  border-collapse: collapse;
  width: 100%;
}

/* Ensure the header stays sticky */
table thead th {
  position: sticky;
  top: 0;
  background: lightyellow;
  z-index: 2; /* Keep header above body content */
}
table thead tr th:nth-child(-n+4),
table thead tr td:nth-child(-n+4),
table th:nth-child(-n+4),
table td:nth-child(-n+4) {
  position: sticky;
  width: 150px !important;
  
  word-wrap: break-word; /* Break long words if necessary */
  
  box-shadow: inset 2px black;

  background: lightyellow;
  overflow-wrap: break-word; /* Break long words if necessary */
  z-index: 1; /* Higher than the header to ensure columns stay on top */
}

/* Adjust position for sticky columns */
table thead tr th:nth-child(1) , 
table thead tr td:nth-child(1) , 
table th:nth-child(1),
table td:nth-child(1) {
  left: 0;
}
table thead tr td:nth-child(2) , 
table th:nth-child(2),
table td:nth-child(2) {
  left: 150px; /* Adjust based on column width */
}

table th:nth-child(3),
table td:nth-child(3) {
  left: 300px; /* Adjust based on cumulative column widths */
}

table th:nth-child(4),
table td:nth-child(4) {
  left: 450px; /* Adjust based on cumulative column widths */
}

